long_description:
ChiccoMata dla niemowlaka 3w1 z melodiami i projektorem niebieska    Innowacyjna Mata dla niemowlaka 3w1 Enjoy Colors z melodiami i kolorowymi projekcjami jest indealna do zabawy i odpoczynu, każdego dnia. Mata First Dreams to aż 3 różne zastosowania:Elektroniczna mata z projekcjami  i melodiami – do zabawy w pozycji na plecach;
Okrągła mata o średnicy 83cm z poduszką do podparcia – do zabawy w pozycji na brzuchu;
Przenośna lampka nocna i projektor z wyłącznikiem czasowym 15 lub 30 min. oraz 3 trybami projekcji i melodii.
 Emitowane światło tworząc efekt koloroterapii, sprawi, że dziecko będzie czuło się zrelaksowane i bezpieczne w swoim pokoiku, a spokojne melodie odtwarzane przez urządzenie ukołyszą je do snu. Zabawka posiada 3 tryby projekcji i melodii:Tryb zabawy: ciepłe kolory i muzyka jazzowa;
Tryb rozrywki: ciepłe i chłodne kolory z melodiami New Age;
Tryb relaksu: chłodne kolory i muzyka klasyczna (Mozart i Grieg).
 Zestaw obejmuje: poduszkę, 2 zawieszki wiszące, 2 grzechotki z tworzywa i materiału.Zarówno poduszkę, jak i matę można prać w pralce.

